import React, { useState, useEffect } from 'react';
import ContactForm from '../components/contact/ContactForm';
import { FaPhone, FaEnvelope, FaMapMarkerAlt, FaClock } from 'react-icons/fa';

const ContactPage = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [contactData, setContactData] = useState(null);

  useEffect(() => {
    fetchContactData();
  }, []);

  const fetchContactData = () => {
    try {
      setLoading(true);
      const data = JSON.parse(localStorage.getItem('contactPageDatabase'));
      if (data) {
        setContactData(data);
      } else {
        setError('Contact page data not found');
      }
      setLoading(false);
    } catch (error) {
      console.error('Error fetching contact page data:', error);
      setError('Failed to load contact page data');
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="pt-16 min-h-screen flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-navy mx-auto"></div>
          <p className="mt-4 text-lg">Loading contact information...</p>
        </div>
      </div>
    );
  }

  if (error || !contactData) {
    return (
      <div className="pt-16 min-h-screen flex items-center justify-center">
        <div className="text-center">
          <p className="text-xl text-red-600 mb-4">Error: {error || 'Contact data not available'}</p>
          <p>Please try again later or contact the administrator.</p>
        </div>
      </div>
    );
  }

  const { hero, contactInfo, form, location, services } = contactData;

  return (
    <div className="pt-16">
      {/* Hero Section */}
      <section className="relative py-20">
        <div className="absolute inset-0 bg-navy/90"></div>
        <div className="container mx-auto px-4 relative z-10">
          <h1 className="text-4xl md:text-5xl font-bold text-white mb-6">
            {hero.title}
          </h1>
          <p className="text-xl text-gray-200 max-w-3xl">
            {hero.description}
          </p>
        </div>
      </section>

      {/* Contact Information */}
      <section className="py-20">
        <div className="container mx-auto px-4">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-16">
            <div className="bg-white p-6 rounded-lg shadow-md">
              <div className="flex items-center mb-4">
                <FaPhone className="text-navy mr-4" />
                <div>
                  <h3 className="text-lg font-semibold text-navy">{contactInfo.phone.title}</h3>
                  <p className="text-gray-600">{contactInfo.phone.value}</p>
                </div>
              </div>
            </div>
            <div className="bg-white p-6 rounded-lg shadow-md">
              <div className="flex items-center mb-4">
                <FaEnvelope className="text-navy mr-4" />
                <div>
                  <h3 className="text-lg font-semibold text-navy">{contactInfo.email.title}</h3>
                  <p className="text-gray-600">{contactInfo.email.value}</p>
                </div>
              </div>
            </div>
            <div className="bg-white p-6 rounded-lg shadow-md">
              <div className="flex items-center mb-4">
                <FaClock className="text-navy mr-4" />
                <div>
                  <h3 className="text-lg font-semibold text-navy">{contactInfo.hours.title}</h3>
                  <p className="text-gray-600">{contactInfo.hours.value}</p>
                </div>
              </div>
            </div>
          </div>

          <div className="grid grid-cols-1 lg:grid-cols-2 gap-12">
            {/* Contact Form */}
            <div>
              <h2 className="text-2xl font-bold text-navy mb-6">{form.title}</h2>
              <ContactForm services={services} />
            </div>

            {/* Map and Address */}
            <div>
              <h2 className="text-2xl font-bold text-navy mb-6">{location.title}</h2>
              <div className="bg-white p-6 rounded-lg shadow-md mb-6">
                <div className="flex items-start mb-4">
                  <FaMapMarkerAlt className="text-navy mt-1 mr-4" />
                  <div>
                    <h3 className="text-lg font-semibold text-navy">{location.address.title}</h3>
                    <p className="text-gray-600">
                      {location.address.line1}<br />
                      {location.address.line2}<br />
                      {location.address.line3}
                    </p>
                  </div>
                </div>
              </div>

              {/* Google Maps iframe */}
              <div className="rounded-lg overflow-hidden shadow-md">
                <iframe
                  src={location.mapEmbedUrl}
                  width="100%"
                  height="400"
                  style={{ border: 0 }}
                  allowFullScreen=""
                  loading="lazy"
                  referrerPolicy="no-referrer-when-downgrade"
                  title="Google Maps"
                ></iframe>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default ContactPage;
